import React, { useState } from "react";
import "./home.css";
import Prada from "./images/prada.jpg";
import Fendi from "./images/fendi.jpg";
import Louis from "./images/louis.jpg";
import Gucci from "./images/Gucci.jpg";
import Supreme from "./images/Supreme.jpeg";
import Boss from "./images/Boss.jpg";
import Boss2 from "./images/Boss2.jpg";
import Dior from "./images/Dior.jpg";
import Dior2 from "./images/Dior2.jpg";
import CarolinaHerrera from "./images/CarolinaHerrera.jpg";
import CarolinaHerrera2 from "./images/CarolinaHerrera2.jpg";
import VersaceB from "./images/VersaceB.jpg";
import versaceN from "./images/versaceN.jpg";
import Rayban from "./images/Rayban.jpg";
import RayBan from "./images/RaynBan2.jpg";
import ChopardM from "./images/ChopardM.jpg";
import Chopard2 from "./images/Chopard2.jpg";

import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import ImageListItemBar from '@mui/material/ImageListItemBar';

const Home = () => {
  const products = [
    { id: 1, name: "Glasses 1", price: 99.99, image: Prada },
    { id: 2, name: "Glasses 2", price: 129.99, image: Fendi },
    { id: 3, name: "Glasses 3", price: 149.99, image: Louis },
    { id: 4, name: "Glasses 4", price: 149.99, image: Gucci },
    { id: 5, name: "Glasses 5", price: 149.99, image: Supreme },
    { id: 6, name: "Glasses 6", price: 149.99, image: Boss },
    { id: 7, name: "Glasses 3", price: 149.99, image: Boss2 },
    { id: 8, name: "Glasses 3", price: 149.99, image: Dior },
    { id: 9, name: "Glasses 3", price: 149.99, image: Dior2 },
    { id: 11, name: "Glasses 3", price: 149.99, image: CarolinaHerrera },
    { id: 12, name: "Glasses 3", price: 149.99, image: CarolinaHerrera2 },
    { id: 13, name: "Glasses 3", price: 149.99, image: VersaceB },
    { id: 15, name: "Glasses 3", price: 149.99, image: versaceN },
    { id: 16, name: "Glasses 3", price: 149.99, image: RayBan },
    { id: 17, name: "Glasses 3", price: 149.99, image: RayBan2 },
    { id: 18, name: "Glasses 3", price: 149.99, image: CarolinaHerrera },
    { id: 19, name: "Glasses 3", price: 149.99, image: CarolinaHerrera },

  ];

  return (
    <div>
      <div id="banner">
        <h1>Bienvenidos a Optica DAFSJR!</h1>
      </div>
      <div id="products">
        {products.map((product) => (
          <div key={product.id} className="product">
            <img src={product.image} alt={`Glasses ${product.id}`} />
            <h2>{product.name}</h2>
            <p>${product.price}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Home;
